import {useState} from 'react';

function Card(){

    let [name,setName] = useState("Iron Man");
    let [name2,setName2] = useState("I AM THE SENSATIONAL");


    function magic(){
        setName("wtf");
        setName2("wtf");
    }

    return(
        <div className="card">
            <h1 className="h1">{name2}</h1>
            <h1>{name}</h1>
            <button className="btn" onClick={magic}>{name}</button>
        </div>
    )
}

export default Card;
